        safeCheck
        returns (string memory)
    {
        return messages[_tokenId].attrNFTName;
    }

    function getAttrKeyword(uint256 _tokenId)
        public
        view
        safeCheck
        returns (string memory)
    {
        return messages[_tokenId].attrKeyword;
    }

    function getMode(uint256 _tokenId)
        public
        view
        safeCheck
        returns (string memory)
    {
        return messages[_tokenId].mode;
    }

    function getAttrCreatorAddr(uint256 _tokenId)
        public
        view
        safeCheck
        returns (address)
    {
        return messages[_tokenId].attrCreatorAddr;
    }

    function getModeCount(string memory _mode) public view returns (uint256) {
        return modes[_mode];
    }

    function DNA(uint256 _tokenId) public view safeCheck returns (bytes32) {
        bytes32 _DNA = keccak256(
            abi.encodePacked(
                messages[_tokenId].name,
                messages[_tokenId].description,
                messages[_tokenId].image,
                messages[_tokenId].message,
                messages[_tokenId].prCreateDate,
                messages[_tokenId].attrNFTName,
                messages[_tokenId].attrKeyword
            )
        );
        return _DNA;
    }

    function withdraw() public payable onlyOwner {
        (bool os, ) = payable(owner()).call{value: address(this).balance}("");
        require(os);
    }
}

